// index.js
import React from 'react';
import ReactDOM from 'react-dom';
import './App.css';
import App from './App.js';
import AppPortfolio from './App.js';

ReactDOM.render(
    <React.StrictMode>
        <App />
        <AppPortfolio />
    </React.StrictMode>,
    document.getElementById('root')
);
